据南非商业科技网站10月19日报道，根据过去的记录，南非将很难实现其吸引1万亿(610亿美元)私人投资于基础设施的雄心。国际货币基金组织(IMF)数据显示，自2016年以来，投资占南非国内生产总值(GDP)的比例一直在下降。IMF预测，今年这一比例将达到13%的历史低点。经济学家表示，疫情让实现复苏变得更加困难，包括南非啤酒厂和玻璃制造商等在内的多家公司都搁置了扩张计划，多数国有企业也面临资金短缺，无法掀起大规模投资热潮。南非政府在按时按预算交付基础设施方面没有任何往绩，南非的固定公共投资回报不仅很低，而且通常是负数。尽管今年6月以来，政府发出优先项目征求建议书和信息的请求，但并不一定意味着即将到来的投资流动。
