据南非商业科技网站10月19日报道，拉马福萨总统近日提出，建议私有化南非部分主要火车路线，以改善南非交通状况。该提案是总统新经济复苏计划的一部分，将通过允许第三方进入铁路网络并更新支线，促进铁路行业的更多参与，主要涉及豪登省和西开普省路线，铁路网络的现代化和恢复工作将在未来六个月内全面启动。南非公路铁路协会表示，多年来一直要求铁路网络上的第三方进入。南非很少对路线进行私有化，路线私有化的标准方法是通过公私合营，政府负责线路的安全和维护，这一计划将释放出巨大发展潜力。目前，为实现这些目标而制定的立法在议会中已进入后期阶段。有关交通运输经济监管的草案可能会在今年年底前敲定，届时将创建一个类似于南非国家公路管理局的机构。
