据央视财经19日消息，今年前三季度，我国肉类进口总金额出现大幅增长，在各类进口产品中增长最快。根据海关数据，今年1-9月，我国肉类进口金额同比增长82.6%，其中进口猪肉328.6万吨，增加132.2%；进口牛肉157.2万吨，增加38.8%。经销商介绍，今年进口牛肉价格呈现两级分化，较低端的进口牛肉，如来自阿根廷、巴西等国的草饲牛价格下跌明显。有经销商表示，他所售卖的老百姓用的比较多的进口牛腩，往年在这个时候终端销售达到三十多元一斤，而目前一斤才二十多块钱。涨价较多的品类主要是澳大利亚和牛的一些部位。
